// Layout.js

import React from 'react';

const Layout = ({ children }) => {
  return (
    <html>
      <head>
        <meta charset="UTF-8" />
        <meta name="viewport" content="width=device-width, initial-scale=1.0" />
        <link href="../../output.css" rel="stylesheet" />
      </head>
      <body>
        {children}
      </body>
    </html>
  );
};

export default Layout;
